import React from 'react';
export default class FormLogin extends React.Component {
    constructor() {
        super();
        this.state = {username:"", password:""}
    }
    getUserName = (e) => {
        this.state.username = e.target.value;
        console.log(this.state);
    }
    getPassWord = (e) => {
        this.state.password = e.target.value;
        console.log(this.state);
    }
    render() {
        const kq = 
            <form className="text-white mx-n2">
                <div className="mb-3 bg-secondary p-2 text-center">FORM LOGIN</div>
                <div className="mb-3">
                    <label>User name</label>
                    <input type="text" onChange={this.getUserName} className="form-control"/>
                </div>
                <div className="mb-3">
                    <label>Password</label>
                    <input type="password" onChange={this.getPassWord} className="form-control"/>
                </div>
                <div className="text-center">
                    <button typy="submit" className="btn btn-primary">Login</button>
                </div>
            </form>
            return (kq);
    }
}
